webpackJsonp([35268789844200],{2082:function(e,o){e.exports={pathContext:{docHtml:'<h1>babel-code-frame</h1>\n<blockquote>\n<p>Generate errors that contain a code frame that point to source locations.</p>\n</blockquote>\n<h2>Install</h2>\n<pre><code class="language-sh">npm install --save-dev babel-code-frame\n</code></pre>\n<h2>Usage</h2>\n<pre><code class="language-js">import codeFrame from \'babel-code-frame\';\n\nconst rawLines = `class Foo {\n  constructor()\n}`;\nconst lineNumber = 2;\nconst colNumber = 16;\n\nconst result = codeFrame(rawLines, lineNumber, colNumber, { /* options */ });\n\nconsole.log(result);\n</code></pre>\n<pre><code class="language-sh">  1 | class Foo {\n> 2 |   constructor()\n    |                ^\n  3 | }\n</code></pre>\n<p>If the column number is not known, you may pass <code>null</code> instead.</p>\n<h2>Options</h2>\n<h3><code>highlightCode</code></h3>\n<p><code>boolean</code>, defaults to <code>false</code>.</p>\n<p>Toggles syntax highlighting the code as JavaScript for terminals.</p>\n<h3><code>linesAbove</code></h3>\n<p><code>number</code>, defaults to <code>2</code>.</p>\n<p>Adjust the number of lines to show above the error.</p>\n<h3><code>linesBelow</code></h3>\n<p><code>number</code>, defaults to <code>3</code>.</p>\n<p>Adjust the number of lines to show below the error.</p>\n<h3><code>forceColor</code></h3>\n<p><code>boolean</code>, defaults to <code>false</code>.</p>\n<p>Enable this to forcibly syntax highlight the code as JavaScript (for non-terminals); overrides <code>highlightCode</code>.</p>',docPath:"argo-ci/node_modules/babel-code-frame/readme",proj:"argo-ci"}}}});
